import React from 'react';
import { MDBContainer, MDBBtn, MDBModal, MDBModalBody, MDBModalHeader, MDBModalFooter } from 'mdbreact';



export class Popup extends React.Component{
  constructor(props){
    super(props);
    this.handleClose=this.handleClose.bind(this);
  }
  handleClose(){
    this.props.handleClose();
  }
  render(){
    return(
      <div classname="popup-main">
      <MDBContainer>
        <MDBModal isOpen={this.props.show} toggle={()=>this.props.handleToggle()} size="fluid">
          <MDBModalHeader toggle={()=>this.props.handleToggle()}>MDBModal title</MDBModalHeader>
          <MDBModalBody>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore
            magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo
            consequat.
          </MDBModalBody>
          <MDBModalFooter>
            <MDBBtn color="secondary" onClick={()=>this.props.handleToggle()}>Close</MDBBtn>
            <MDBBtn color="primary">Save changes</MDBBtn>
          </MDBModalFooter>
        </MDBModal>
      </MDBContainer>
      </div>

    );
  }
}
export default Popup;
